import './App.css';
import HelloWorld from './components/helloworld'; 
import frase from './components/Frases';            

function App() {
  return (
    <div className="App">
      <h1>MEU APP REACT</h1>
      <HelloWorld />
      <Frase />  {/* Nome do componente ajustado */}
    </div>
  );
}

export default App;
